// src/pages/Schedule.js
import React from 'react';
import { Container, Typography, Paper } from '@mui/material';

export const Schedule = () => {
  return (
    <Container>
      <Paper sx={{ p: 3, mt: 3 }}>
        <Typography variant="h4">Schedule</Typography>
        {<p>Here is the schedule</p>}
      </Paper>
    </Container>
  );
};
